script: |
  super -f text -I q12123.spq | sort > q12123.out

inputs:
  - name: q12123.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - 22 * - col0 NOT IN ( col0 + - 61, + col2 / - col0, - col0, + ( + + col2 ) );
  - name: tab1

outputs:
  - name: q12123.out
    data: |
      51	14	96
      85	5	59
      91	47	68
